import React from 'react';
import ReactDOM from 'react-dom';
import ReactKline from '../../src';
import $ from 'jquery'
window.code = 'BABA';
window.codeName = '阿里巴巴';
class App extends React.Component {
    constructor(){
        super();
        this.state={
            symbol:'baba'
        }
    }

    onRequestData(param,callback){
        let dataCall = [];
        $.ajax({
            type: "GET",
            url: "http://fss.91stock.net/fss/Kline/GetKline?code="+param.symbol,//192.168.84.68:8081
            contentType: 'application/x-www-form-urlencoded;charset=utf-8',
            dataType: "json",
            async:  true,
            success: function(data){
                dataCall = data.kline.data.item;
                callback({success:true,data:{
                        lines:dataCall,
                        coordinates: data.coordinates,
                        monthCoordinates: data.monthCoordinates,
                        symbol:data.kline.data.symbol
                    }});
            },
            error:function(e){
                console.log(e);
            }
        });
    }

    onSymbolChange(){
        this.setState({
            symbol:'aapl'
        })
    }
    onSymbolChange2(){
        this.setState({
            symbol:'AABA'
        })
    }

    render() {

        return (
            <div>
                <button onClick={this.onSymbolChange.bind(this)}>11111111111111</button>
                <button onClick={this.onSymbolChange2.bind(this)}>11111111111111</button>
                <ReactKline
                    // width={600}
                    // height={688}
                    ranges={["1d"]}

                    symbol={this.state.symbol}
                    symbolName={this.state.symbol}
                    intervalTime={5000000}
                    depthWidth={100}
                    // debug={true}
                    onRequestData={this.onRequestData}
                />
            </div>
        );
    }
}

ReactDOM.render(
    <App />,
    document.getElementById('root')
);
